import React from 'react'
import { PokemonCard } from './PokemonCard'
import './Cards.css'
export const AllCards = ({ results }) => {
    results.map(res=>(console.log(res.url)))
    return (
        <div className='container-pokemon'>
            <ul className='cards'>
                {results.map(res =>
                (
                    <div className='card-item' key={res.name}>
                        <PokemonCard url={res.url}/>
                    </div>
                ))}
            </ul>
        </div>
    )
}
